"   </div>",
"   <div class=\"lgnd\">",
"    In the upper diagram, the transducer is place at the base of the heart; ie, 2nd intercostal space to the left of the sternum; the plane runs from the right hip to the left shoulder. The portion of the heart labeled RV is actually the right ventricular outflow tract (RVOT). The lower panels show the echocardiographic images which are centered on the pulmonary artery, one of the most important targets for examination. In panel A, the pulmonary artery (MPA) is of normal caliber and two of the three leaflets of the pulmonary valve are seen (PV). Note that the RVOT narrows when it reaches the PV ring, that the bifurcation (Bi) of the MPA can be seen and that in normal anatomy the aortic root (Ao) and MPA differ slightly in caliber (MPA&gt;AO). In panel B, the MPA is dilated due to chronic pulmonary hypertension; the relation of the MPA to the Ao differs sharply from the normal.",
