var title_f41_45_42715="Treatment and monitoring of neurosyphilis";
var content_f41_45_42715=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F86764&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F86764&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Treatment and monitoring of neurosyphilis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Treatment recommendations:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Recommended regimen:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Aqueous crystalline penicillin G 18 to 24 million units a day, administered as 3 to 4 million units IV every&nbsp;four&nbsp;hours for 10 to 14 days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Alternative regimen with compliant patients or if outpatient treatment deemed appropriate:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Procaine penicillin 2.4 million units IM a day, PLUS Probenecid 500 mg orally four times a day, both for 10 to 14 days,",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        <strong>",
"         or",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Ceftriaxone 2 grams IM or IV once a day for 10 to 14 days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Some experts recommend administering benzathine penicillin, 2.4 million units IM, after completion of these&nbsp;two-week regimens to ensure&nbsp;three weeks total duration of therapy as for latent disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Follow-up plans:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        If CSF pleocytosis was present initially, repeat CSF evaluation every&nbsp;six months until cell count is normal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        CSF-VDRL or CSF protein can persist",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        If cell count has not decreased after&nbsp;six months, or if CSF is not normal after&nbsp;two years, consider retreatment",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Original figure modified for this publication. Rompalo AM. Neurosyphilis. In: Johnson R, Griffin J, McArthur J (Eds), Current Therapy and Neurology Disease, Mosby, Inc. New York, 2001. Table used with the permission of Elsevier Inc. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
