var title_f41_45_42716="ACC AHA Rx HF other diseases";
var content_f41_45_42716=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F80859&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F80859&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    ACC/AHA guideline summary: Management of concomitant diseases in patients with heart failure (HF)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Class I - There is evidence and/or general agreement that the following approaches are effective for the management of concomitant diseases in patients with HF.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull;  All recommendations for HF therapy should apply to patients with concomitant disorders unless there are specific exceptions.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       &bull;  Treatment of concomitant diseases:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       1. Control of systolic and diastolic hypertension according to current guidelines.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       2. Control of diabetes mellitus according to current guidelines.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       3. Nitrates and beta blockers for the treatment of angina.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       4. Coronary revascularization for angina according to current guidelines.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       5. Anticoagulation for paroxysmal or persistent atrial fibrillation or a previous thromboembolic event.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       6. Control of the ventricular response in patients with atrial fibrillation with a beta blocker (or amiodarone if the beta-blocker is contraindicated or not tolerated).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       7. Treatment of coronary artery disease according to current guidelines.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       8. Antiplatelet agents for prevention of MI and death in patients with coronary artery disease.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Class IIa - The weight of evidence or opinion is in favor of the usefulness of the following approaches for the management of concomitant diseases in patients with HF",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull;  Control the ventricular response in patients with atrial fibrillation with digitalis.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull;  Amiodarone to decrease recurrence of atrial arrhythmias and recurrence of implantable cardioverter-defibrillator discharge for ventricular arrhythmias.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Class IIb - The weight of evidence or opinion is less well established for the usefulness of the following approaches for the management of concomitant diseases in patients with HF",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull;  Restoration and maintenance of sinus rhythm in patients with atrial fibrillation.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull;  Anticoagulation in the absence of atrial fibrillation or a previous thromboembolic events.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull;  Enhancing erythropoiesis in patients with anemia.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Class III - There is evidence and/or general agreement that the following approaches are not useful or may be harmful for the management of concomitant diseases in patients with HF",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull;  Class I or III antiarrhythmic drugs to prevent ventricular arrhythmias.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull;  Antiarrhythmic drugs as primary treatment of asymptomatic ventricular arrhythmias or to improve survival.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Hunt SA, Abraham WT, Chin MH, et al. 2009 focused update incorporated into the ACC/AHA 2005 Guidelines for the Diagnosis and Management of Heart Failure in Adults: a report of the American College of Cardiology Foundation/American Heart Association Task Force on Practice Guidelines: developed in collaboration with the International Society for Heart and Lung Transplantation. Circulation 2009; 119:e391.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
